import styled from 'styled-components';
const Wrapper = styled.div`
  height:100%;
  width:100%;
  margin: auto;
  margin-top:7px;
  overflow-y:scroll; 
  transform:
    perspective(2000px)
    translate3d(0px, -66px, 198px)
    rotateX(-55deg)
    scale3d(0.86, 0.75, 1)
    translateY(50px);
  will-change: transform;
  transition: 0.4s ease-in-out transform;

  &:hover {
    transform: scale3d(1, 1, 1);
  }*/

  `;

export default Wrapper;
